(window.webpackJsonp=window.webpackJsonp||[]).push([[111],{465:function(n,h,t){"use strict";t.r(h);var c=t(44),g=Object(c.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1077-hi"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1077-hi"}},[n._v("#")]),n._v(" Chương 1077: Hi")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1077: Hi"),t("br"),t("br"),n._v("“Giết chết chín cái?”"),t("br"),t("br"),n._v("“Ngươi không có nói đùa chớ?”"),t("br"),t("br"),n._v("Kê Nham, Đàm Thanh trợn mắt hốc mồm, cảm thấy có chút phát điên."),t("br"),t("br"),n._v("Hai năm qua, bọn họ cùng Thiên Diệp Vương đấu trí đấu dũng, bị buộc đều nhanh điên rồi, đều không có làm gì được nó đối phương nửa phần, ngược lại phía bên mình danh sư càng ngày càng ít, đều nhanh chết hết."),t("br"),t("br"),n._v("Đối phương một cái Tòng Thánh, gặp tới cùng tên cái khác chín vị, toàn bộ giết chết... Thật hay giả?"),t("br"),t("br"),n._v("“Không chỉ có như vậy, Thiên Diệp Vương từng phân ra một đạo ý niệm, giấu ở trong chúng ta, cũng bị hắn chỉnh suýt chút nữa phế bỏ...”"),t("br"),t("br"),n._v("Ngô sư nói tiếp: “Cho nên, ta cảm thấy, hắn chỉ cần cẩn thận, sẽ không có quá nhiều nguy hiểm, thậm chí... Đem hắn cùng Thiên Diệp Vương đặt ở một cái phòng, cuối cùng chết khẳng định cũng là người sau!”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Kê Nham hai người rất lâu đều nói không ra lời nói đến, qua thật lâu, thế này mới đúng nhìn: “Danh sư học viện, đây rốt cuộc chọn lựa một cái dạng gì viện trưởng?”"),t("br"),t("br"),n._v("Trước đó, bọn họ vẫn cảm thấy, Trương Huyền tuổi trẻ, trong sân dài khẳng định không được, nghe được nhiều chuyện như vậy dấu vết mới biết được..."),t("br"),t("br"),n._v("Chỉ sợ Chương Dẫn Khâu so sánh cùng nhau, cũng kém rất xa."),t("br"),t("br"),n._v("Bên này mọi người khiếp sợ, bên kia Trương Huyền đã rời đi trận pháp phạm vi, đến Phong Thánh các rộng lớn trong đại sảnh."),t("br"),t("br"),n._v("“Như vậy đi qua khẳng định sẽ bị phát hiện, vẫn là Vu hồn đi!”"),t("br"),t("br"),n._v("Thân thể nhoáng một cái, tìm tới một cái góc hẻo lánh, tinh thần khẽ động, thân thể đi vào Thiên Nghĩ Phong sào, Vu hồn lặng lẽ bay lên."),t("br"),t("br"),n._v("Cứ như vậy quang minh chính đại đi qua lời nói, rất dễ dàng bị phát giác, muốn chạy trốn cũng khó khăn, chỉ là Vu hồn lời nói, nguy hiểm liền sẽ yếu bớt không ít."),t("br"),t("br"),n._v("Mặc dù đối phương đạt đến Xuất Khiếu cảnh, thần thức mạnh mẽ có thể nhẹ nhõm phát giác hết thảy chung quanh tình huống, nhưng mà thần thức cũng không phải là bất cứ lúc nào cũng sẽ thả ra, lão hổ đều có ngủ gật thời điểm, chỉ cần hắn không sẵn sàng, hỗn đến trước mặt, trộm vài thứ hẳn là dễ như trở bàn tay."),t("br"),t("br"),n._v("Vu hồn lặng lẽ tiến lên, dựa theo trước đó Kê Nham nói tới phương vị, một đường bay đi, thời gian không dài, một cái rộng lớn đại điện xuất hiện trước mắt."),t("br"),t("br"),n._v("Đại điện chung quanh, cùng Kê Nham bọn họ chỗ ở tương đồng, cũng che kín đủ loại trận pháp, thấp nhất đều đạt đến cấp bảy, người bình thường rơi vào trong đó, khẳng định sẽ bị mê huyễn, tìm không thấy phương vị, mà Trương Huyền hiện tại đã là Thất Tinh đỉnh phong trận pháp sư, trận pháp mặc dù rườm rà, vẫn như cũ khó không được ánh mắt của hắn."),t("br"),t("br"),n._v("Dựa theo trận pháp lượn quanh một hồi, đi tới cửa vào đại điện, Trương Huyền lặng lẽ hướng phía trong nhìn lại."),t("br"),t("br"),n._v("Điện đường rộng lớn, tản ra linh khí nồng nặc, trong đó mọc như rừng vô số bảo vật, tựa như một cái cực lớn tàng bảo khố."),t("br"),t("br"),n._v("Đại bộ phận đều là một chút dược liệu, đan dược loại hình, vũ khí loại hình cũng không nhiều, thậm chí không nhìn thấy."),t("br"),t("br"),n._v("Càng nhiều vẫn là một chút sách, đều là liên quan tới làm sao đột phá Thánh vực."),t("br"),t("br"),n._v("Nhìn tới lúc trước Khổng sư, vì để cho hậu bối đột phá, thành công phong Thánh, hao tốn không ít tâm huyết."),t("br"),t("br"),n._v("“Thế mà không tại...”"),t("br"),t("br"),n._v("Minh Lý Chi Nhãn vận chuyển, hướng bên trong nhìn một vòng, thế mà không có phát hiện Thiên Diệp Vương tung tích, Trương Huyền mắt sáng rực lên."),t("br"),t("br"),n._v("Chẳng lẽ cái tên này cũng không ở bên trong?"),t("br"),t("br"),n._v("“Trước mặc kệ, không tại tốt nhất!”"),t("br"),t("br"),n._v("Vốn còn nghĩ đối phương ở bên trong, hẳn là như thế nào trà trộn vào đi, đã không tại, vậy liền không chút kiêng kỵ."),t("br"),t("br"),n._v("Khống chế trữ vật giới chỉ trước bay vào, lập tức Vu hồn tiến vào bên trong."),t("br"),t("br"),n._v("Trong phòng bảo vật số lượng rất nhiều, đủ loại Thánh cấp dược liệu cộng lại, chừng mấy trăm loại, bốn phía có trận pháp đặc biệt phong ấn, mặc dù thả ở không biết bao nhiêu năm, nhưng ở chung quanh linh khí làm dịu cũng không có mất đi dược hiệu, ngược lại phẩm chất càng thêm trân quý."),t("br"),t("br"),n._v("“Khó trách cái này Thiên Diệp Vương không đem đồ vật thu vào trữ vật giới chỉ, chỉ sợ những vật này, rất khó phá vỡ...”"),t("br"),t("br"),n._v("Nhìn thấy những này phong ấn bộ dáng, Trương Huyền mỉm cười."),t("br"),t("br"),n._v("Thứ này cùng trong lòng đất phong ấn đồng dạng, đối danh sư tới nói, có thể lấy ra, nhưng đối Dị Linh tộc tới nói, sẽ rất khó làm được."),t("br"),t("br"),n._v("Nói cách khác, mặc dù Thiên Diệp Vương ngày ngày thủ tại chỗ này, đáng tiếc, rất nhiều thứ đều là thấy được sờ không tới."),t("br"),t("br"),n._v("Nếu không, cho dù có thánh quang áp chế, thực lực của hắn cũng tất nhiên so hiện tại cao hơn ra một đoạn dài tới."),t("br"),t("br"),n._v("“Muốn lấy dược liệu, nhất định phải có thân thể cùng danh sư thân phận mới được...”"),t("br"),t("br"),n._v("Vu hồn kêu gọi, giấu ở Thiên Nghĩ Phong sào bên trong thân thể lập tức xuất hiện trong phòng, Vu hồn quy vị, đứng lên."),t("br"),t("br"),n._v("Hoạt động một chút gân cốt, Trương Huyền lúc này mới hướng trước mắt rất nhiều linh dược cùng sách nhìn sang."),t("br"),t("br"),n._v("Sách hầu như đều là liên quan tới làm sao đột phá Thánh vực, những vật này, sưu tập đủ nhiều, Phong Thánh giải cũng có, không cần thiết tiếp tục xem tiếp."),t("br"),t("br"),n._v("“Thánh vực rỗng ruột cỏ, Thiên Long hoa, mộc hương căn... Những dược liệu này, cấp bậc mặc dù không phải đặc biệt cao, nhưng đều là dùng để đột phá Thánh vực tuyệt cao bảo vật, có thể làm cho người thoát thai hoán cốt, vô luận linh hồn hay là thân thể, đều phát sinh kinh người lột xác!”"),t("br"),t("br"),n._v("Nhìn một vòng, Trương Huyền nhẹ gật đầu."),t("br"),t("br"),n._v("Nơi này dược liệu, hầu như đều đối đột phá Thánh vực có trợ giúp, Khổng sư hẳn là nghĩ đến đủ loại đột phá khả năng, lúc này mới chuyên môn sưu tập nhiều như vậy dược vật."),t("br"),t("br"),n._v("“Quả nhiên có Đoạn Tục thảo...”"),t("br"),t("br"),n._v("Rất nhanh, một gốc dược liệu xuất hiện tại tầm mắt."),t("br"),t("br"),n._v("Đúng là hắn muốn tìm Đoạn Tục thảo."),t("br"),t("br"),n._v("Thứ này có thể bù đắp trong thân thể sinh cơ, phối hợp một chút dược vật, có thể khiến người ta thân thể lột xác thành càng mạnh mẽ hơn Thánh vực thân thể, dùng để đột phá Thánh vực mặc dù quá mức xa xỉ, cũng tuyệt đối là bảo vật hiếm có."),t("br"),t("br"),n._v("“Lấy trước đi lại nói...”"),t("br"),t("br"),n._v("Thân thể nhoáng một cái, đi tới trước mặt, bàn tay lập tức hướng trong phong ấn dược liệu bắt tới."),t("br"),t("br"),n._v("Ông!"),t("br"),t("br"),n._v("Cùng phong ấn tiếp xúc, lập tức cảm thấy một đạo cường đại lực cản, đem hắn bàn tay ngăn lại, căn bản duỗi không đi vào."),t("br"),t("br"),n._v("Không cách nào đụng vào Đoạn Tục thảo, liền không có cách nào thu vào nhẫn, chỉ có thể đi một chuyến uổng công."),t("br"),n._v("“Hừ, ta không tin còn không đụng tới!”"),t("br"),t("br"),n._v("Thấy phong ấn chỉ là ngăn cản, cũng không có lực sát thương, hừ lạnh một tiếng, Trương Huyền bắp thịt toàn thân kéo căng, lực lượng đột nhiên gia tăng."),t("br"),t("br"),n._v("Kẽo kẹt! Kẽo kẹt!"),t("br"),t("br"),n._v("Phong ấn giống như là bị bóp nghiến bóng da, đánh càng kịch liệt, đối kháng lực cũng liền càng lớn."),t("br"),t("br"),n._v("“Kỳ quái...”"),t("br"),t("br"),n._v("Liên tục tăng lực, chân khí trong cơ thể vận chuyển tới cực hạn, đều không cách nào đụng tới Đoạn Tục thảo, Trương Huyền mày nhăn lại, đang nghĩ đưa cánh tay lùi về, lại phát hiện, trước mắt phong ấn giống như là dịch nhờn, đưa bàn tay một mực dính trụ, căn bản không tránh thoát được."),t("br"),t("br"),n._v("“Kỳ quái trận pháp...”"),t("br"),t("br"),n._v("Trương Huyền dở khóc dở cười."),t("br"),t("br"),n._v("Cái khác trận pháp, loại trừ nguy hiểm liền là nguy hiểm, cái này ngược lại tốt, bàn tay bỏ vào, mang theo co dãn, rút trở về thế mà còn bị dính trụ, nhìn tới không đem dược liệu lấy đi, khẳng định là không cách nào rời đi."),t("br"),t("br"),n._v("“Vu hồn!”"),t("br"),t("br"),n._v("Đã chân khí, thân thể để hắn đủ không được dược liệu, tấm lông mày nâng lên, Vu hồn lực lượng lập tức khởi động lên."),t("br"),t("br"),n._v("Ông!"),t("br"),t("br"),n._v("Cỗ lực lượng này gia tăng, trận pháp lập tức sóng nước di động, trở nên càng đánh."),t("br"),t("br"),n._v("Trương Huyền chân khí trong cơ thể, đã sớm đạt đến Tòng Thánh đỉnh phong, thân thể đạt tới Ngũ Diệu kim thân đệ ngũ trọng viên mãn, Vu hồn kinh qua Lôi Nguyên châu tẩm bổ, từ lâu đột phá đến Tòng Thánh đỉnh phong, ba cái lực lượng điệp gia, cho dù Thánh vực tam trọng cường giả cũng chưa chắc có thể chống đỡ được."),t("br"),t("br"),n._v("Trước mắt trận pháp, phát ra “Kẹt kẹt!” Thanh âm, theo hình tròn biến thành hình bầu dục, lại biến thành bánh rán bộ dạng."),t("br"),t("br"),n._v("“Đi vào...”"),t("br"),t("br"),n._v("Trên đầu như là lò hơi nước, vận chuyển chân khí quá nhanh, mạo hiểm xì xì khói trắng."),t("br"),t("br"),n._v("Giằng co một lát, Trương Huyền hét lớn một tiếng, bàn tay bỗng nhiên hướng về phía trước dò xét đi qua, ngón giữa đầu ngón tay, rốt cục tại giằng co hai, sau ba phút, đụng phải trong phong ấn Đoạn Tục thảo cành lá bên trên."),t("br"),t("br"),n._v("Vù vù!"),t("br"),t("br"),n._v("Đem hắn thu vào trữ vật giới chỉ."),t("br"),t("br"),n._v("Soạt!"),t("br"),t("br"),n._v("Dược liệu vừa tiến vào nhẫn, lực đàn hồi mười phần trận pháp lập tức phát ra “Ba” một tiếng, biến mất ở trước mắt."),t("br"),t("br"),n._v("Hình như không có dược liệu, phong ấn cũng mất đi giá trị đồng dạng, chủ động tán loạn."),t("br"),t("br"),n._v("“Nhìn tới Khổng sư mặc dù lưu lại dược liệu, nhưng cũng tương đương lưu lại khảo nghiệm, những thuốc này, cũng không đủ thực lực, căn bản không bỏ ra nổi tới! Đoán không sai, muốn giống ta dạng này lấy ra dược vật, đoán chừng chỉ có thể là Tòng Thánh đỉnh phong, cấp bậc mạnh, khẳng định càng thêm khó khăn. Như vậy cũng có thể cam đoan, dược vật là vì đột phá Thánh vực mà dùng, còn đồng thời có thể kiểm nghiệm cần dược liệu hậu bối, có thể hay không có tư cách phong Thánh!”"),t("br"),t("br"),n._v("Lau lau mồ hôi trên đầu, Trương Huyền mặt mũi cười khổ."),t("br"),t("br"),n._v("Không hổ là vạn thế chi sư, suy nghĩ quả nhiên chu toàn."),t("br"),t("br"),n._v("Thực lực vượt qua, hoặc là không đủ, đều khó có khả năng nhận được dược vật, cho dù nhìn xem cũng vô dụng."),t("br"),t("br"),n._v("Cho nên, Thiên Diệp Vương cũng đủ bi kịch, ở đây trông hai năm, một gốc dược liệu đều không có nắm bắt tới tay, nhìn tới Kê Nham đám người cũng không biết rõ tình hình, lúc này mới cảm thấy thực lực của hắn tiến bộ, cùng những thuốc này liên quan đến."),t("br"),t("br"),n._v("“Cái khác dược liệu mặc dù rất tốt, nhưng... Lấy ra quá phí sức, hiện tại Đoạn Tục thảo tới tay, rời đi trước cho thỏa đáng, nếu không, Thiên Diệp Vương trở về, muốn đi đều đi không được...”"),t("br"),t("br"),n._v("Một ngụm trọc khí phun ra."),t("br"),t("br"),n._v("Những dược liệu này mặc dù rất tốt, nhưng nơi này thực sự quá nguy hiểm, muốn lấy đi cũng phiền phức, một khi bị Thiên Diệp Vương ngăn chặn, muốn chạy trốn cũng khó khăn."),t("br"),t("br"),n._v("Đang định rời phòng, đột nhiên con mắt khẽ động, rơi vào một cái vật kỳ quái bên trên."),t("br"),t("br"),n._v("Là một đoàn từ bảy loại màu sắc hội tụ mà thành dung dịch, tại trong phong ấn xoay chầm chậm, tản mát ra đặc thù khí tức."),t("br"),t("br"),n._v("“Cái này, cái này... Đây chẳng lẽ là... Thất Thải Địa Quỳnh dịch?”"),t("br"),t("br"),n._v("Trương Huyền hô hấp lập tức dồn dập lên, toàn thân cứng ngắc."),t("br"),t("br"),n._v("Hắn Phong Thánh giải tu luyện tới Tòng Thánh đỉnh phong, muốn đột phá, chỉ kém đồng dạng bảo vật, cái kia chính là Thất Thải Địa Quỳnh dịch."),t("br"),t("br"),n._v("Bất quá, thứ này sinh trưởng ở địa mạch chỗ sâu, thế nhân hiếm thấy, liền xem như hắn, đều chỉ nghe qua tên, chưa bao giờ thấy qua."),t("br"),t("br"),n._v("Trước mắt thứ này, tản mát ra bảy loại ánh sáng, lại cho hắn một loại, cảm giác thân cận, càng là Khổng sư tự mình lưu lại, không cần nghĩ, khẳng định là thứ này!"),t("br"),t("br"),n._v("“Có thứ này, phong Thánh lại có gì khó...”"),t("br"),t("br"),n._v("Nắm đấm xiết chặt, Trương Huyền thân thể nhoáng một cái đã đi tới trước mặt, năm ngón tay mở ra, lập tức hướng phong ấn bắt tới."),t("br"),t("br"),n._v("Thứ này là nhất định phải lấy được, chỉ cần luyện hóa, vây lại như thế liền Tòng Thánh đỉnh phong, liền có thể thuận lợi đột phá!"),t("br"),t("br"),n._v("Trong lòng đất đạt tới Tòng Thánh đỉnh phong đến bây giờ, thời gian cũng đầy đủ lâu."),t("br"),t("br"),n._v("Kẽo kẹt! Kẽo kẹt!"),t("br"),t("br"),n._v("Nương theo lực lượng của hắn, phong ấn lần nữa bẹp xuống, chân khí, thân thể, hồn lực, vừa bắt đầu liền vận chuyển tới cực hạn."),t("br"),t("br"),n._v("“Chạy rất nhanh, hừ, Trương Huyền, lần sau đừng để ta gặp gỡ, nếu không, tuyệt đối để ngươi chết không có chỗ chôn...”"),t("br"),t("br"),n._v("Đang dùng đem hết toàn lực đủ trong phong ấn Thất Thải Địa Quỳnh dịch, liền nghe đến đại điện bên ngoài một cái hừ lạnh vang lên, lập tức một cái cao lớn thân ảnh đi đến."),t("br"),t("br"),n._v("Chính là Thiên Diệp Vương."),t("br"),t("br"),n._v("Một bên nhắc tới, một bên đẩy cửa, vừa tiến vào gian phòng, lập tức phát hiện không đúng, lập tức thấy được cách đó không xa bàn tay đang cắm ở trong phong ấn, muốn vào vào không được, nghĩ ra ra không được thanh niên."),t("br"),t("br"),n._v("“Ngươi...” Một mặt nổi giận, đang muốn động thủ, chỉ thấy đối phương giơ lên một cái khác cánh tay, lên tiếng chào."),t("br"),t("br"),n._v("“Hi!”"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1085"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1087"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);